import React from "react";
import Box3 from "./Box3";
import styled from "styled-components";
const Box2 = () => {
  const Box3 = styled.div`
    position: absolute;
    background: purple;
    height: 300px;
    width: 300px;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
  `;
  return (
    <div className="box2">
      <Box3></Box3>
    </div>
  );
};

export default Box2;
